public synchronized Priority getJobPriority() {
  JobReportProtoOrBuilder p = viaProto ? proto : builder;
  if (this.jobPriority != null) {
    return this.jobPriority;
  }
  if (!p.hasJobPriority()) {
    return null;
  }
  this.jobPriority = convertFromProtoFormat(p.getJobPriority());
  return this.jobPriority;
}
